import axios from 'axios';
import React, { Component } from 'react';

import './index.scss'

export default class magent extends Component {

    state = {
        magents: []
    }

    componentDidMount() {
        const _this = this
        axios.get("http://localhost:3001/api/magent")
        .then(function (response) {
            _this.setState({
                magents: response.data
            })
        })
        .catch(function (err) {
            console.log(err)
        })
    }

    render() {
        const { magents } = this.state

        return (
            <div className="magent-card">
                <div className="magent-card-top">
                    <div className="app-card__subtext">
                        {
                            magents.map((magent) => {
                                return(
                                    <div>
                                        <span>{ magent.time }</span>
                                        <span>{ magent.auth }</span>
                                        <span>{ magent.name }</span>
                                        <span>{ magent.dow }</span>
                                    </div>
                                )
                            })
                        }
                    </div>
                </div>
            </div>
        );
    }
}
